  return (
    <TooltipProvider>
      <Component {...pageProps} />
    </TooltipProvider>
  );
}

export default MyApp;
```
## Create the Tooltip Component

Create a new file called Tooltip.js in the components folder.
```
import { useTooltip } from '../context/TooltipContext';

const Tooltip = ({ children, content }) => {
  const { tooltipOpen, setTooltipOpen, closeTooltip } = useTooltip();

  return (
    <div className="relative">
      <div
        onClick={() => setTooltipOpen(!tooltipOpen)}
        className="cursor-pointer"
      >
        {children}
      </div>
      {tooltipOpen && (
        <div className="absolute z-10 bg-gray-700 text-white p-2 rounded">
          {content}
        </div>
      )}
    </div>
  );
};

export default Tooltip;
```
