      delay: 0.1,
      duration: 0.5,
    }, 'start');

    tl.set($portfolioCurrent.current, {
      clipPath: 'polygon(0% 0%, 100% 0%, 100% 100%, 0% 100%)',
    });

    tl.set($portfolioCurrent.current, {
      css: { backgroundImage: 'url(' + cursor.cursorImage + ')' },
    });

    setLastRun(currentTime);
  }
}, [cursor.cursorImage]);
```

Here's how it works:

1. We introduce a new state variable called `lastRun` using the `useState` hook. It keeps track of the timestamp of the last time the code was executed.

2. Inside the `useEffect` hook, we first get the current timestamp using `Date.now()` and calculate the time elapsed since the last run by subtracting `lastRun` from the current timestamp.

3. We check if the time elapsed since the last run is greater than or equal to 600 milliseconds (0.6 seconds) using the condition `timeSinceLastRun >= 600`.

4. If the condition is true, we execute the code inside the `if` block, which is the same as your original code.

5. After executing the code, we update the `lastRun` state with the current timestamp using `setLastRun(currentTime)`. This ensures that the next execution will only happen after the specified delay of 0.6 seconds.

6. The `useEffect` hook will still run whenever `cursor.cursorImage` changes, but the code inside the `if` block will only execute if the specified delay has passed since the last execution.

By using this approach, the code inside the `useEffect` hook will only run once every 0.6 seconds, even if `cursor.cursorImage` changes more frequently.

